    const data = Papa.parse(csvText, { header: true }).data;
    window.mapData = data;

    const dropdown = document.getElementById("variabel");
    dropdown.addEventListener("change", () => updateMap(dropdown.value));
    updateMap(dropdown.value);

    function updateMap(variabel) {
      const values = data.map(d => parseFloat(d[variabel])).filter(n => !isNaN(n));
      const min = Math.min(...values);
      const max = Math.max(...values);

      function getColor(value) {
        if (isNaN(value)) return "#ccc";
        const ratio = (value - min) / (max - min);
        var c = Math.round(255 - ratio * 200);
        return 'rgb(' + c + ',' + c + ',255)';
      }

      data.forEach(row => {
        const wilayah = row.Wilayah.trim();
        const el = document.getElementById(wilayah);
        if (el) {
          const val = parseFloat(row[variabel]);
          el.style.fill = getColor(val);
        }
      });
    }
